L'Assemblea Nazionale e' il massimo organismo dirigente nazionale composto da 250 componenti eletti dal congresso nazionale fondativo di Sel svoltosi nell'ottobre dello scorso anno a Firenze.
I lavori dell'assemblea nazionale -aperti alla stampa- si sono svolti nel Centro Congressi Frentani dalle ore 10 alle ore 17. I lavori sono stati aperti dalla relazione di Nichi Vendola.

